import React from 'react';
import { View, StyleSheet } from 'react-native';
import Header from './component/Header/Header';
import Home from './component/Home/Home';
import { HomeTab } from './component/TabNavigators';
import TabNavigators from './component/TabNavigators/TabNavigators';

const App = () => {
    return (
        <View style={styles.app_container}>
            <Header />
            <Home />
            <HomeTab />
        </View>


    );
}

const styles = StyleSheet.create({
    app_container: {
        width: '100vw',
        height: '100vh',
        backgroundColor: "#fff",
    }
})

export default App;
